import React from "react";

export const ACCOUNT_MAKER_LINK = () =>{

    return <React.Fragment>

        <div
        style={{
            display:'flex',
            flexDirection: 'column',
            justifyContent: 'space-around',
            alignItems: 'center',
            fontFamily: '큐트신민상',
            whiteSpace: "nowrap",
            height: '5vh'

        }}
        >

        <span>
        Join us as a member
        </span>

        <a href="/login">
        <span
        style={{
            backgroundColor: 'white',
            padding: '0.5vh 2vw',
            borderRadius: '10px',
        }}
        >
        Sign - up
        </span>
        </a>

        </div>


    </React.Fragment>

}

export default ACCOUNT_MAKER_LINK;
